import { Button } from '@material-ui/core';
import { Link as NextLink } from 'next/Link'

export const DesktopMenu = ({ list }) => {
  return (
    <div>
      {list.map(item => (
        <NextLink href={item.href}>
          <Button color="inherit">Login</Button>
        </NextLink>
      ))}


      <Button color="inherit">Register</Button>
    </div>
  );
};
